import jwt from "jsonwebtoken";
import { Op, Sequelize } from "sequelize";
import db from "../models/index";
const bcrypt = require("bcrypt");
import Cookies from "cookies";

const addcategory = async (req, res) => {
  try {
    let categoryname = req.body.categoryname;
    let icon = req.body.icon;

    const [user, created] = await db.Category.findOrCreate({
      where: { categoryname: categoryname },
      defaults: {
        categoryname: categoryname,
        icon: icon,
      },
    });
    if (!created) {
      return res.status(200).json({
        status: 1,
        message: "category da ton tai",
      });
    }
    return res.status(200).json({
      status: 0,
      message: "thanh cong",
    });
  } catch (e) {
    console.log(e);
  }
};
const updatecategory = async (req, res) => {
  try {
    let categoryname = req.body.categoryname;
    let icon = req.body.icon;
    let id = req.body.id;

    await db.Category.update(
      { categoryname: categoryname, icon: icon },
      {
        where: { id: id },
      }
    );

    return res.status(200).json({
      status: 0,
      message: "thanh cong",
    });
  } catch (e) {
    console.log(e);
  }
};
const deletecategory = async (req, res) => {
  try {
    let id = req.body.id;

    await db.Category.destroy({ where: { id: id } });

    return res.status(200).json({
      status: 0,
      message: "thanh cong",
    });
  } catch (e) {
    console.log(e);
  }
};
const getcategory = async (req, res) => {
  try {
    const data = await db.Category.findAll({
      include: [{ model: db.Role, as: "all" }],
      nest: true,
      raw: false,
    });

    return res.status(200).json({
      status: 0,
      data: data,
    });
  } catch (e) {
    console.log(e);
  }
};

const addrole = async (req, res) => {
  try {
    let rolename = req.body.rolename;
    let categoryid = req.body.categoryid;

    const [user, created] = await db.Role.findOrCreate({
      where: { rolename: rolename },
      defaults: {
        categoryid: categoryid,
        Rolename: rolename,
      },
    });
    if (!created) {
      return res.status(200).json({
        status: 1,
        message: "role da ton tai",
      });
    }
    return res.status(200).json({
      status: 0,
      message: "thanh cong",
    });
  } catch (e) {
    console.log(e);
  }
};
const getrole = async (req, res) => {
  try {
    const data = await db.Role.findAll({
      include: [{ model: db.Category, as: "all" }],
      nest: true,
      raw: false,
    });

    return res.status(200).json({
      status: 0,
      data: data,
    });
  } catch (e) {
    console.log(e);
  }
};
const updaterole = async (req, res) => {
  try {
    let id = req.body.id;
    let Rolename = req.body.Rolename;

    await db.Role.update(
      {
        Rolename: Rolename,
      },
      {
        where: {
          id: id,
        },
      }
    );

    return res.status(200).json({
      status: 0,
      message: "oke",
    });
  } catch (e) {
    console.log(e);
  }
};
const getroletype = async (req, res) => {
  try {
    let id = req.body.id;
    const data = await db.Role.findAll({
      where: {
        categoryid: id,
      },
    });

    return res.status(200).json({
      status: 0,
      data: data,
    });
  } catch (e) {
    console.log(e);
  }
};
const getbrand = async (req, res) => {
  try {
    let limit = req.body.limit;
    if (limit === "full") {
      const data = await db.Brand.findAll();
      if (data) {
        for (let i = 0; i < data.length; i++) {
          data[i].image = new Buffer(data[i].image, "base64").toString(
            "binary"
          );
        }
      }
      return res.status(200).json({
        status: 0,
        data: data,
      });
    } else {
      const data = await db.Brand.findAll({
        limit,
      });
      if (data) {
        for (let i = 0; i < data.length; i++) {
          data[i].image = new Buffer(data[i].image, "base64").toString(
            "binary"
          );
        }
      }
      return res.status(200).json({
        status: 0,
        data: data,
      });
    }
  } catch (e) {
    console.log(e);
  }
};
const updatebrand = async (req, res) => {
  try {
    let brandname = req.body.brandname;
    let id = req.body.id;

    await db.Brand.update(
      {
        brandname: brandname,
      },
      {
        where: { id: id },
      }
    );

    return res.status(200).json({
      status: 0,
      message: "oke",
    });
  } catch (e) {
    console.log(e);
  }
};
const addbrand = async (req, res) => {
  try {
    let brandname = req.body.brandname;
    let image = req.body.image;

    const [user, created] = await db.Brand.findOrCreate({
      where: { brandname: brandname },
      defaults: {
        image: image,
        brandname: brandname,
      },
    });
    if (!created) {
      return res.status(200).json({
        status: 0,
        message: "brand da ton tai",
      });
    }
    return res.status(200).json({
      status: 0,
      message: "thanh cong",
    });
  } catch (e) {
    console.log(e);
  }
};

const gettypebrand = async (req, res) => {
  try {
    let type = req.body.type;
    if (+type === 0) {
      const data = await db.Brand.findAll({
        where: {
          [Op.or]: [
            { brandname: { [Op.startsWith]: "0" } },
            { brandname: { [Op.startsWith]: "1" } },
            { brandname: { [Op.startsWith]: "2" } },
            { brandname: { [Op.startsWith]: "3" } },
            { brandname: { [Op.startsWith]: "4" } },
            { brandname: { [Op.startsWith]: "5" } },
            { brandname: { [Op.startsWith]: "6" } },
            { brandname: { [Op.startsWith]: "7" } },
            { brandname: { [Op.startsWith]: "8" } },
            { brandname: { [Op.startsWith]: "9" } },
          ],
        },
      });
      if (data) {
        for (let i = 0; i < data.length; i++) {
          data[i].image = new Buffer(data[i].image, "base64").toString(
            "binary"
          );
        }
      }

      return res.status(200).json({
        status: 0,
        data: data,
      });
    } else {
      const data = await db.Brand.findAll({
        where: {
          brandname: { [Op.like]: `${type}%` },
        },
      });
      if (data) {
        for (let i = 0; i < data.length; i++) {
          data[i].image = new Buffer(data[i].image, "base64").toString(
            "binary"
          );
        }
      }

      return res.status(200).json({
        status: 0,
        data: data,
      });
    }
  } catch (e) {
    console.log(e);
  }
};

const addproduct = async (req, res) => {
  try {
    let types = req.body.types;
    let productname = req.body.productname;
    let category_id = req.body.category_id;
    let brand_id = req.body.brand_id;
    let role_id = req.body.role_id;
    let productdes = req.body.productdes;
    let price = req.body.price;
    let saleprice = req.body.saleprice;
    let type = req.body.type;
    let image = req.body.image;
